#include <iostream>
#include <vector>
#include <string>
#include <map>
#include <set>
#include <queue>
#include <sstream>
#include <limits>
#include <algorithm>
#include <unordered_map>
#include <unordered_set>
using namespace std;

typedef long long LL;
class CountMap {
    vector<int> counts;
    int types;
public:
    CountMap(): counts(vector<int>(26)), types(0){};
    void add(char c) {
        counts[c - 'a']++;
        if (counts[c - 'a'] == 1) {
            types++;
        }
    }
    void remove(char c) {
        counts[c - 'a']--;
        if (counts[c - 'a'] == 0) {
            types--;
        }
    }
    int getTypes() {
        return types;
    }
};
class Solution {
public:
    long long appealSum(string s) {
        LL ans = 0;
        for (LL appeal = 1; appeal <= 26; appeal++) {
            ans += (LL)appeal * (LL)countString(s, appeal);
        }
        return ans;
    }
    LL countString(const string &s, int appeal) {
        LL ans = 0;
        CountMap loMap, hiMap;
        int n = s.size();
        for (int start = 0, lo = -1, hi = -1; start < n; start++) {
            if (start > 0) {
                // remove lastChar
                auto lastChar = s[start - 1];
                loMap.remove(lastChar);
                hiMap.remove(lastChar);
            }
            // fix lo
            while (loMap.getTypes() < appeal && lo + 1 < n) {
                lo++;
                loMap.add(s[lo]);
            }
            // fix hi
            while (hiMap.getTypes() <= appeal && hi < n) {
                hi++;
                if (hi < n) {
                    hiMap.add(s[hi]);
                } else {
                    break;
                }
            }
            // done
            if (loMap.getTypes() == appeal && hi >= lo) {
                ans += (LL)(hi - lo);
            }
        }
        return ans;
    }
};

int main() {
    cout << Solution().appealSum(string("")) << endl;
    return 0;
}
